import "../../styles/recipes.scss";
import recipeData from "./data";

const RecipeCard = ({ index }) => {
  const data = recipeData[index];
  return (
    <div className="recipeCard">
      <div className="recipeCard__name">
        <h6>{data.name}</h6>
      </div>
    </div>
  );
};

export default RecipeCard;
